Tutorial1. Using the generatorIn the getting started section we have learned how to create a skeleton application with the web-sdk command.The skeleton application contains two base map layers, OSM streets and ESRI world imagery, and a single widget, the LayerList widget.The main file of the application is app.jsx. Open up this file in your favorite text editor. Look for the definition of ol.Map. The map gets defined with a layer group, that combines the OSM streets and ESRI world imagery layers. The view is defined with an initial  center and zoom level. If you are not familiar with OpenLayers 3, the recommendation is to use the workshop at http://openlayers.org/workshop/ to get up to speed with OpenLayers 3.2. Adding a vector layer from a GeoJSON fileCreate a subdirectory called data in the root of the application directory, download USA states data as GeoJSON from: http://data.okfn.org/data/datasets/geo-boundaries-us-110m and save it to the data subdirectory.mkdir data
curl "https://raw.githubusercontent.com/datasets/geo-boundaries-us-110m/master/json/ne_110m_admin_1_states_provinces_shp_scale_rank.geojson" -o data/ne_110m_admin_1_states_provinces_shp_scale_rank.geojson
Add the following layer definition in app.jsx after the existing ol.layer.Group:  new ol.layer.Vector({
    id: 'states',
    title: 'USA States',
    source: new ol.source.Vector({
      url: 'data/ne_110m_admin_1_states_provinces_shp_scale_rank.geojson',
      format: new ol.format.GeoJSON()
    })
  })
And change the view's center so that the GeoJSON layer will be visible on start up:  view: new ol.View({
    center: [-10605790.55, 4363637.07],
    zoom: 4
  })
The full map definition should now look like:var map = new ol.Map({
  layers: [
    new ol.layer.Group({
      type: 'base-group',
