Creating application componentsIntroductionThis tutorial will show how to add additional functionality in the form of components to applications built using the Boundless Web SDK.Three examples will be shown:Component that acts like a MapTool (DrawBox)

Component that shows output (BoxInfo)

Modify the DrawBox component so it shows a popup

These examples illustrate how to draw a box on a map and how to query that box (get its area).Drawing boxes with a .Component that acts like a MapToolThe component will add a button called ‚ÄúDraw Box‚Äù to the toolbar which when clicked will allow the user to draw a rectangle on the map.To begin, create a new application:web-sdk ~/myapp
cd ~/myapp
nvm use 6.0.0
npm i
npm start
Verify in the browser that the application is running successfully by navigating to http://localhost:3000/, replacing localhost with the name of the host where the Web SDK is being served.Add a toolbarThe first step is adding a toolbar so we have a container to put in our new MapTool. Open up app.jsx and add an import statement for the toolbar:import Toolbar from 'material-ui/lib/toolbar/toolbar';
Add the Toolbar component to the render method:  


Open up app.css and change the .map selector to take into account the space that the toolbar takes up:#map {
  position: absolute;
  top: 56px;
  width: 100%;
  left: 0px;
  height: calc(100% - 56px);
}
Also move the layer list and zoom button to be a child of MapPanel:  



Open up app.css to give the zoom buttons the correct z-index so it's on top of the map:#zoom-buttons {
  z-index: 1100;
  margin-left: 20px;
  position: absolute;
  top: 20px;
}
We have now prepared the application for writing our own tool and adding it to the toolbar.Create a new directory js/components and create a new file in it named DrawBox.jsx. Copy and paste the following content:import React from 'react';
import ol from 'openlayers';
import ToolUtil from 'boundless-sdk/js/toolutil.js';
import RaisedButton from 'boundless-sdk/js/components/Button.jsx';

class DrawBox extends React.Component { 
  constructor(props) { 
    super(props);
    this._dispatchToken = ToolUtil.register(this);
    var source = new ol.source.Vector({wrapX: false});
    this._interaction = new ol.interaction.Draw({
      source: source,
      type: 'LineString',
      geometryFunction: function(coordinates, geometry) { 
        if (!geometry) { 
          geometry = new ol.geom.Polygon(null);
        } 
        var start = coordinates[0];
        var end = coordinates[1];
        geometry.setCoordinates([
          [start, [start[0], end[1]], end, [end[0], start[1]], start]
        ]);
        return geometry;
      },
      maxPoints: 2 
    });
    this._layer = new ol.layer.Vector({
      title: null, /* to keep it out of the LayerList */
      style: new ol.style.Style({
        stroke: new ol.style.Stroke({
          color: this.props.strokeColor
        })
      }),
      source: source,
      zIndex: 100000
    });
    this.props.map.addLayer(this._layer);
  } 
  componentWillUnmount() { 
    AppDispatcher.unregister(this._dispatchToken);
  } 
  activate(interactions) { 
    ToolUtil.activate(this, interactions);
  } 
  deactivate() { 
    ToolUtil.deactivate(this);
  } 
  _drawBox() { 
    this.activate(this._interaction);
  } 
  render() { 
    return ( 

    );
  }
}

DrawBox.propTypes = {
  strokeColor: React.PropTypes.string
};

DrawBox.defaultProps = {
  strokeColor: '#FF0000'
};

export default DrawBox;
Open up app.jsx and add an import for our new DrawBox component:import DrawBox from './js/components/DrawBox.jsx';
and add a DrawBox to the Toolbar:  


Save and reload the browser. You will now see a button in the Toolbar that reads Draw Box. Let's examine the code in more detail.Any MapTool kind of component will have the following:import ToolUtil from 'boundless-sdk/js/toolutil.js';

  constructor(props) {
    super(props);
    this._dispatchToken = ToolUtil.register(this);
    ...

  componentWillUnmount() {
    AppDispatcher.unregister(this._dispatchToken);
  }
  activate(interactions) {
    ToolUtil.activate(this, interactions);
  }
  deactivate() {
    ToolUtil.deactivate(this);
  }
In the constructor, we will register for all the events on the application dispatcher that are tool related. This means we will get deactivated automatically when another tool in the same toggleGroup gets activated. In the componentWillUnmount function we will unregister those listeners. Any map tool will have to have an activate and deactivate function. In our case, when the button is pressed, we will activate our instance of `ol.interaction.Draw. Optionally it can also have an enable and disable function to handle disabling itself in 3D mode and enabling itself in 2D mode.In our constructor we are creating a vector source to keep our boxes, and a draw interaction that can draw box geometries. Using a vector layer the boxes are displayed on the map, using a stroke color that can be configured by the end user and defaults to red.Open up app.jsx and change our DrawBox to have a blue stroke color:
Component that shows outputIn this exercise we will be creating a new component that will show the area of a box that is drawn by the DrawBox tool. In order to have 2 components communicate, we need to use the AppDispatcher. First, we need to prepare the HTML structure of the application for the box info panel. Open up app.jsx and wrap the Toolbar and MapPanel in a new div:  

After this div, add a new row for our box info:  

The complete render function will now look like:  render() {
    return (













    );
  }
Open up app.css and give some space to our boxinfo container:.container {
  height: 75%;
}
.boxinfo {
  position: absolute;
  top: 75%;
  width: 100%;
  height: 25%;
}
And change the height of the map to:height: calc(75% - 56px);
We have now prepared a container for our new component. Create a new file js/components/BoxInfo.jsx and open it up in your favourite text editor:import React from 'react';
import AppDispatcher from 'boundless-sdk/js/dispatchers/AppDispatcher.js';

class BoxInfo extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      boxInfo: []
    };
    var me = this;
    AppDispatcher.register((payload) => {
      let action = payload.action;
      switch (action.type) {
        case 'DRAWBOX':
          var geom = action.geometry;
          var start = 0;
          // only show 5 last entries
          if (me.state.boxInfo.length > 4) {
            start = me.state.boxInfo.length - 4;
          }
          var boxInfo = me.state.boxInfo.slice(start);
          boxInfo.push(this.props.tplText.replace('{area}', geom.getArea()));
          me.setState({boxInfo: boxInfo});
          break;
        default:
          break;
      }
    });

  }
  render() {
    var boxInfo = [];
    boxInfo.push({this.props.title});
    for (var i = 0, ii = this.state.boxInfo.length; i {this.state.boxInfo[i]});
    }
    return ({boxInfo});
  }
}

BoxInfo.propTypes = {
  title: React.PropTypes.string,
  tplText: React.PropTypes.string
};


BoxInfo.defaultProps = {
  title: 'Box info',
  tplText: 'Area: {area}'
};

export default BoxInfo;
Later on we will examine this code in more detail, but for now just copy and paste this code. Open up app.jsx and add the BoxInfo component:import BoxInfo from './js/components/BoxInfo.jsx';

..



Now when drawing a box we want to display the area in the box info tool, but nothing will happen as yet. This is because we are not firing DRAWBOX as yet through the AppDispatcher from the DrawBox tool. Open up DrawBox.jsx and make the following changes:import AppDispatcher from 'boundless-sdk/js//dispatchers/AppDispatcher.js';

  source.on('addfeature', function(evt) {
    AppDispatcher.handleAction({
      type: 'DRAWBOX',
      geometry: evt.feature.getGeometry()
    });
  }, this);
Add the addfeature listener in the constructor. Reload the browser and a draw a box. After drawing the box, its area should get displayed. Now we will investigate the BoxInfo code in more detail. In the constructor we register a listener on the AppDispatcher for DRAWBOX, the geometry will get sent in the payload. We will keep information from the last 5 drawn boxes, and it will get displayed by calling setState with the boxInfo array. The BoxInfo component can get configured with 2 properties:title, the title to display in the header of the panel

tplText, the template text to display for each box

Now open up app.jsx and edit our BoxInfo definition:
and verify that these changes have effect.Modify the DrawBox component so it shows a popupIn this exercise we will be changing the DrawBox component so that it will also show an InfoPopup after drawing a box with its area. Open up js/components/DrawBox.jsx in your favourite text editor and make the following addition for the import:import ToolActions from 'boundless-sdk/js/actions/ToolActions.js';
Also modify the addfeature listener of the vector source:    source.on('addfeature', function(evt) {
      evt.feature.set('AREA', evt.feature.getGeometry().getArea());
      ToolActions.showPopup(evt.feature, this._layer);
      ..
This will set the AREA as an attribute on the feature and will call the showPopup function of ToolActions to display the popup for this feature. However our changes are not yet complete, we need to make 2 more changes. Open up js/components/DrawBox.jsx and change the definition of the layer:  popupInfo: '#AllAttributes',
This will indicate that all the feature's attributes need to get displayed in the popup, in our case this is only AREA. Now open up app.jsx:import InfoPopup from 'boundless-sdk/js/components/InfoPopup.jsx';
In the render function add the InfoPopup after the MapPanel:
And then change the DrawBox configuration so it is in the same toggleGroup:
Now reload the application and a draw a box. It should a popup with its area as well.

developers.html.body:
Information for component developersIntroductionThe Web SDK is based on EcmaScript 6 (ES6). It uses babelify to translate to ES5.
It is based on OpenLayers 3, React 15 and Flux.
For the user interface, material-ui React components are used. See http://www.material-ui.com for more information.
For internationalization, Yahoo's react-intl (v2) is used.
Node and npm are used as the development environment.ReactComponent API (e.g. componentWillMount, componentWillUnmount) is important to know about.
Components have properties (this.props), more like configuration options.
Components have state (this.state), and on change of state (setState) they are re-rendered.
React uses a virtual DOM, so it can diff the changes and only apply those (performance).
Render method needs to return single root ( can be used as workaround).
To pass on all properties to a child component use: {‚Ä¶this.props}.
Define propTypes static on the class, for example: Chart.propTypes = { charts: React.PropTypes.array.isRequired };.JSXJSX is an XML like syntax to create components. For example:
It can be nested, and can be mixed with normal HTML.
You can use the ref property instead of the HTML id (ref='map' in JSX and then this.refs.map in code).
Babelify will transform this to regular javascript.FluxFlux means Uni-directional flow of data.
A dispatched change needs to be handled, before another one can commence.
It has concepts such as stores, actions, dispatchers.
This is internal to the SDK, the app developer should not need to know too much about it.
The store extends the standard EventEmitter class.
Stores should be singletons.
We use a central application dispatcher that extends Flux‚Äôs Dispatcher.
Actions are functions that ask the dispatcher to handle certain actions (using constants).
Components (or stores) can register listener from actions on the dispatcher. An example:AppDispatcher.register((payload) => {
  let action = payload.action;
  switch(action.type) {
    case SelectConstants.SELECT_FEATURES_IN:
      // do something
      break;
    default:
      break;
  }
});
Internationalisation (i18n)At the component level:import {defineMessages, injectIntl, intlShape} from ‚Äòreact-intl';

const messages = defineMessages({
  buttontitle: {
    id: 'homebutton.buttontitle',
    description: 'Title for the home button',
    defaultMessage: 'Home'
  }
});

class HomeButton extends React.Component {
  render() {
    const {formatMessage} = this.props.intl;
    return (

    );
  }
}

HomeButton.propTypes = {
 intl: intlShape.isRequired
};

export default injectIntl(HomeButton);
At the application level:import {addLocaleData, IntlProvider} from ‚Äòreact-intl';
import enLocaleData from 'react-intl/dist/locale-data/en.js';
import enMessages from 'boundless-sdk/locale/en.js';

addLocaleData(
  enLocaleData
);

ReactDOM.render(, document.getElementById('main'));
We use the babel-plugin-react-intl to extract messages from source code.
It generates JSON files per component.
npm run i18n generates i18n template for all components in locale/en.js
In .babelrc this is activated with:  "plugins": ["react-intl"],
  "extra": {
    "react-intl": {
      "messagesDir": "./build/messages/",
      "enforceDescriptions": true
    }
  }
API docsUses react-docgen, which reads a documentation block on top of the class and a documentation block on top of each prop.
npm run generate:docs will generate the API docs.CSSTwo approaches are used:dr-frankenstyle

cssify (browserify transform)

dr-frankenstyleTool by Pivotal that looks for style keys in package.json of all node dependencies.
It will bundle this up with all the resources (fonts, images).
dr-frankenstyle is used to generates dist/css/* for the SDK.cssifyA post install task copies css files needed from external components (such as fixed-data-table).
By using import statements to css files, browserify bundles up the css (but won‚Äôt copy any needed resources, so this only works for plain css).  import './FeatureTable.css';
Debug serverCan be used by any Web SDK application. In package.json:  "sdk-debug-server": "git+https://github.com/bartvde/sdk-debug-server.git"
To use it in a node script file:require('sdk-debug-server').startServer();
Any application generated by the web-sdk will facilitate this.Proxy to local geoserverAdd the following dependency to your package.json:"json-http-proxy": "1.0.0-ALPHA-4",
To start the proxy, add a script to the package.json file:"start:proxy": "node_modules/.bin/json-http-proxy -p 4000",
Using npm run start:proxy will start up the proxy server on port 4000 using config from proxy-config.json:{
  "routes": [
    {
      "path": "/geoserver/*",
      "upstream": "geoserver"
    },
    {
      "path": "/*",
      "upstream": "default"
    }
  ],
  "upstreams": {
    "geoserver": {
      "protocol": "http",
      "hostname": "localhost",
      "port": 8080
    },
    "default": {
      "port": 3000
    }
  }
}
This means in another shell you will need to start up the normal debug server on port 3000 using npm start.
